import React from "react";
import SchoolsMap from "../../components/Maps/SchoolsMaps";

export default function TestMapPage() {
    const schools = [
        { id: 1, name: "Haifa", lat: 32.794, lng: 34.989 },
        { id: 2, name: "Tel Aviv", lat: 32.0853, lng: 34.7818 },
    ];

    return (
        <div style={{ height: "100vh", width: "100vw" }}>
            <SchoolsMap schools={schools} />
        </div>
    );
}
